'captchahelp-text' => '\'\'\'Q:  Why am I being asked to solve a math equation?\'\'\'<br/>A:  Websites that accept postings from the public, such as wikiHow, are often abused by spammers that use automated tools to post their links to many sites. While these spam links can be removed, it is bothersome and time consuming.

\'\'\'Q:  How does the Captcha system work?\'\'\'<br/>A:  Sometimes, especially when adding new web links to a page, a website may show you an image of colored or distorted text and ask you to type the words shown. Since this is a task that\'s hard to automate, it will allow most real humans to make their posts while stopping most spammers and other robotic attackers.

\'\'\'Q:  I am using a text- or speech-based program to browse the web.  Where can I find assistance in using Captcha?\'\'\'<br/>A:  Unfortunately, Captcha may inconvenience users with limited vision or those that use text-based or speech-based browsers.  At the moment, we do not have an audio alternative available. Please contact any \'\'\'[[WikiHow:Administrators|wikiHow administrator]]\'\'\' for assistance if this is unexpectedly preventing you from making legitimate posts.

